"use strict";
/**
 242. Valid Anagram
Easy
Given two strings s and t, return true if t is an anagram of s, and false otherwise.

An Anagram is a word or phrase formed by rearranging the letters of a different word or phrase, typically using all the original letters exactly once.

 

Example 1:

Input: s = "anagram", t = "nagaram"
Output: true
Example 2:

Input: s = "rat", t = "car"
Output: false
 

Constraints:

1 <= s.length, t.length <= 5 * 104
s and t consist of lowercase English letters.
 

Follow up: What if the inputs contain Unicode characters? How would you adapt your solution to such a case?
 
 */
class Global {
}
Global.data = 0;
function isAnagram(s, t) {
    //recursive
    let text1 = s.split('');
    let text2 = t.split('');
    if (text1.length === 0 && text2.length === 0) {
        return true;
    }
    if (text1.length === 0 || text2.length === 0) {
        console.log('b1');
        return false;
    }
    if (text2.includes(text1[0])) {
        const character = text1[0];
        const ch1 = text1.filter((ch) => character === ch);
        const ch2 = text2.filter((ch) => character === ch);
        if (ch1.length === ch2.length) {
            const txt1 = text1.join('').replace(character, '');
            const txt2 = text2.join('').replace(character, '');
            // console.log(txt1, txt2)
            return isAnagram(txt1, txt2);
        }
    }
    return false;
    /**
     Iterative

     
    if (s.length !== t.length) return false

    const store: { [key: string]: number } = {}

    for (let char of s) {
        store[char] = (store[char] || 0) + 1
    }

    for (let char of t) {
        if (!store[char]) return false
        store[char]--
    }

    return true
     */
}
;
console.log(isAnagram('alagram', 'aalgram')); //true
console.log(isAnagram('cat', 'tat')); //false
console.log(isAnagram('car', 'rat')); //false
console.log(isAnagram('anagram', 'nagaram')); //true
